import React from 'react'

class CardGenerator extends React.Component {
	constructor(props) {
    super(props);

    this.state = {
			data: []
		}
  }

	render() {
		return (
			<div>
				{this.state.data.map((item, index) => 
					<div>
						{ item }
					</div>
					)}
			</div>
		)
	}
}

export default CardGenerator;
